const Skills = () => {
  return (
    <section id="skills" className="bg-black text-white py-16">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold">My Skills</h2>
        <div className="mt-6 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {/* Skill 1 */}
          <div className="bg-gray-800 p-6 rounded-md">
            <h3 className="text-xl font-semibold">Skill 1</h3>
            <p className="mt-4 text-lg">A description of the skill you excel at.</p>
          </div>

          {/* Skill 2 */}
          <div className="bg-gray-800 p-6 rounded-md">
            <h3 className="text-xl font-semibold">Skill 2</h3>
            <p className="mt-4 text-lg">A description of the skill you excel at.</p>
          </div>

          {/* Skill 3 */}
          <div className="bg-gray-800 p-6 rounded-md">
            <h3 className="text-xl font-semibold">Skill 3</h3>
            <p className="mt-4 text-lg">A description of the skill you excel at.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
